// cluster module to run multiple node process and load balance between them
const cluster = require('cluster');
// os module to get number of CPU cores
const os = require('os');
// express module to create express app
const express = require('express');
// cors module to allow cross origin resource sharing
const cors = require('cors');
// swagger module to create swagger documentation
const swagger = require('../swagger');
// userRoute module to define user routes
const apiRoute = require('./routes/userRoute')
// dotenv module to load environment variables
const env = require('dotenv');
// eslint-disable-next-line no-unused-vars
const config = require('./configs/config');
// config
env.config();
// winston module to log errors
const winston = require('winston');
const logger = winston.createLogger({
    level: 'info',
    format: winston.format.json(),
    transports: [
        new winston.transports.Console(),
        new winston.transports.File({ filename: 'log.log' }),
    ],
});
if (!process.env.ISDEV) {
    if (cluster.isMaster) {
        // Fork worker processes for each CPU core
        for (let i = 0; i < os.cpus().length; i++) {
            cluster.fork();
        }
    } else {
        // Create an Express app

        const app = express();
        const port = process.env.ISDEV ? 8080 : process.env.PORT;
        app.use(cors());
        app.use(express.json());

        // Define your routes and middleware
        swagger(app);
        app.use('/api', apiRoute);

        // Start the Express server
        app.listen(port, () => {
            logger.info(`Worker ${process.pid} running on ${port}`);
        });
    }
} else {
    const app = express();
    const port = process.env.ISDEV ? process.env.DEV_PORT : process.env.PORT;
    // use cors to allow cross origin resource sharing
    app.use(cors());
    // use express json to parse json body
    app.use(express.json());
    // Define your routes and middleware
    swagger(app);
    app.use('/api', apiRoute);
    // Start the Express server
    app.listen(port, () => {
        logger.info(`Worker ${process.pid} running on ${port}`);
    });
}

